class Practica09 extends Component {

  state = { numero: 1 }

  render() {
    let arr=[1,2,3,4];
    let arrG=[];
    let nRandom=0;
    return (
      <div>
            <button onClick={()=>nRandom=Math.random()}>Alumnos al azar</button>
            <p>Alumno {arr.at(nRandom*10)}</p>
            <p>Lista de alumnos</p>
      </div>
    )
  }
}
export default Practica09;
